import React from 'react';

const Title = () => {
  return (
    <div className="title">
      <h1>FotoGrid</h1>
      <h2> Awesome Photobook  </h2>
      <p> Try uploading some photos to show the whole World <br></br> that you have access to the internet ☃️ </p>
    </div>
  )
}

export default Title;
